// Navbar.js
import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav>
      <select>
        <option value="home">Home</option>
        <option value="settings">Settings</option>
        <option value="movies">Movies</option>
      </select>
    </nav>
  );
};

export default Navbar;
